import React, {useState} from 'react';
import "./registration.css";
import Input from "../../utils/input/input";
import {useDispatch} from "react-redux";
import {login} from "../../actions/user";


const useInput = (initialState) =>{
    
}

const Login = () => {
    const [email,setEmail] = useState('')
    const [password,setPassword] = useState('')
    const dispatch = useDispatch();
    return (
        <div className={'registration'}>
            <div className="registration_header">Authorization</div>
            <Input value={email} setValue={setEmail} type={"text"} placeholder={"input email..."}/>
            <Input value={password} setValue={setPassword} type={"password"} placeholder={"input password..."}/>
            <button className="registration_btn" onClick={()=>dispatch(login(email,password))}>Log in</button>
        </div>
    );
};

export default Login;
